import React from "react";

const Styles = {
  countDiv: {
    height: "13vh",
    backgroundColor: "blue",
    width: "7%",
    borderRadius: "10px",
    marginRight: "1%",
    display: "flex",
    flexDirection: "column",
    justifyContent: "space-around",
    alignItems: "center",
  },
  countParentDiv: {
    display: "flex",
    justifyContent: "center",
  },
};

class HomePageComponent extends React.Component {
  //   constructor(props) {
  //     super.props();
  //     this.state = {};
  //   }

  fetchJsonData = () => {
    fetch("https://f0ztti2nsk.execute-api.ap-south-1.amazonaws.com/v1/consignment/fetch", {
      method: "post",
      body: { email: "vkaruna7.kv@gmail.com" },
      headers: { "Content-Type": "application/json" },
    })
      .then((res) => res.json())
      .then((json) => console.log(json));
  };

  render() {
    return (
      <div>
        <div
          style={{
            borderBottom: "groove",
            display: "flex",
            justifyContent: "space-between",
            height: "10vh",
            alignItems: "center",
          }}
        >
          <div>
            <span>Intugine</span>
          </div>
          <div style={{ display: "flex", width: "30%", justifyContent: "space-around" }}>
            <div>
              <span>Home</span>
            </div>
            <div>
              <span>Brands</span>
            </div>
            <div>
              <span>Transporters</span>
            </div>
            <div></div>
          </div>
        </div>
        <div>
          <div style={Styles.countParentDiv}>
            <div style={Styles.countDiv}>
              <span>DEL</span>
              <span>916</span>
            </div>
            <div style={Styles.countDiv}>
              <span>INT</span>
              <span>916</span>
            </div>
            <div style={Styles.countDiv}>
              <span>OOD</span>
              <span>916</span>
            </div>
            <div style={Styles.countDiv}>
              <span>DEX</span>
              <span>916</span>
            </div>
            <div style={Styles.countDiv}>
              <span>NFI</span>
              <span>916</span>
            </div>
          </div>
          <div onClick={() => this.fetchJsonData()}>Home</div>
        </div>
      </div>
    );
  }
}

export default HomePageComponent;
